description:
**UNFURNISHED** **2 MONTH DEPOSIT** **2BED APT**

IRES REIT are delighted to present this 2 bedroom apartment for rent in priorsgate. The property comprises of kitchen/ living room, 2 double bedrooms, main bathroom and and a balcony. This complex is located on the corner of N81 and Greenhills Road. A central courtyard provides a welcome open space and residents are close to the M50 and Luas Red line.


Features 

Dedicated property manager 
Full time maintenance team (office hours) and emergency 24-hour maintenance service 
Bright and spacious accommodation; 

Balcony off living room; 
Intercom access; 
LUAS Red line offers good transportation; 
Easy access to M50; Courtyard garden; 
Spar and Unicare Pharmacy on site; Tallaght hospital nearby; 
Tallaght Institute of Technology and IDA Technology park in the area and The Square Shopping Centre is a short walk away.

Prospect Privacy Notice: Personal data you submit in the Contact form is processed by IRES Fund Management Limited according to applicable laws and our privacy statement http://www.iresfund.ie/privacy-policy/ and may involve data transfer outside the EEA.
